import { Button } from '@material-ui/core';
import React, { useState, useEffect } from 'react';
import { UserLogin } from '../User/UserLogin';


export const UserUnknown = () => {

    const [register, setRegister] = useState(true);
    const [login, setLogin] = useState(true);

    const registerHandler = () => {
        setRegister(false)
    }

    const loginHandler = () => {
        setLogin(false)
    }



    return (
        <>
            <div className="user">
                <div className={login === true ? "userLogin" : "userNoLogin"}>
                    <div className="loginDetails">
                        <span className="loginTitle">Bienvenido,
                            carnavalero</span>
                    </div>
                    {login === true ? <div className="loginSubtitle"><span>See all the new features we’ve added through our tutorial.</span>
                        <span>See all the new features we’ve added through our tutorial.</span></div> : ""}
                    {login === false ? <form className="loginForm">
                        <label >Username</label>
                        <input type="text" />
                        <label >Password</label>
                        <input type="password" />
                        <label >Email</label>
                        <input type="mail" />


                    </form> : ""}


                    <div className="loginButtons">

                        <Button onClick={registerHandler} variant="contained" color="primary">Registrarse</Button>
                        <Button onClick={loginHandler} variant="contained" color="primary">Iniciar sesión</Button></div>
                </div>
            </div>

        </>
    );
}
